import React from 'react';
import './App.css';
import Header from './components/Header';
import Footer from './components/Footer';
import { Container } from 'react-bootstrap';

function App() {
  return (
    <>
      <Header />
      <main>
        <Container>
          <h1>React App is Working!</h1>
        </Container>
      </main>
      <Footer />
    </>
  );
}

export default App;
